import Footer from "./components";
import Navbar from "./components";
import Main from "./components";
import Hero from "./components";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Main />
      <Hero />
      <Footer />
    </div>
  );
}

export default App;
